DROP TABLE IF EXISTS `flight`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `flight` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `account_id` bigint(20) DEFAULT NULL,
  `plane_id` bigint(20) DEFAULT NULL,
  `pic_id` bigint(20) DEFAULT NULL,
  `sic_id` bigint(20) DEFAULT NULL,
  `sic_custom` varchar(255) DEFAULT NULL,
  `trip_number` varchar(255) DEFAULT NULL,
  `airport_from_id` bigint(20) DEFAULT NULL,
  `airport_to_id` bigint(20) DEFAULT NULL,
  `departure_date` datetime DEFAULT NULL,
  `risk_factor_sum` bigint(20) DEFAULT NULL,
  `risk_factor_type` varchar(255) DEFAULT NULL,
  `mitigation_sum` bigint(20) DEFAULT NULL,
  `info` text,
  `drafted` tinyint(1) DEFAULT '1',
  `status` varchar(255) DEFAULT 'new',
  `created_at` datetime NOT NULL,
  `updated_at` datetime NOT NULL,
  PRIMARY KEY (`id`),
  KEY `account_id_idx` (`account_id`),
  KEY `plane_id_idx` (`plane_id`),
  KEY `pic_id_idx` (`pic_id`),
  KEY `sic_id_idx` (`sic_id`),
  KEY `airport_from_id_idx` (`airport_from_id`),
  KEY `airport_to_id_idx` (`airport_to_id`),
  CONSTRAINT `flight_account_id_account_id` FOREIGN KEY (`account_id`) REFERENCES `account` (`id`) ON DELETE CASCADE,
  CONSTRAINT `flight_airport_from_id_airport_id` FOREIGN KEY (`airport_from_id`) REFERENCES `airport` (`id`) ON DELETE CASCADE,
  CONSTRAINT `flight_airport_to_id_airport_id` FOREIGN KEY (`airport_to_id`) REFERENCES `airport` (`id`) ON DELETE CASCADE,
  CONSTRAINT `flight_pic_id_sf_guard_user_id` FOREIGN KEY (`pic_id`) REFERENCES `sf_guard_user` (`id`) ON DELETE CASCADE,
  CONSTRAINT `flight_plane_id_plane_id` FOREIGN KEY (`plane_id`) REFERENCES `plane` (`id`) ON DELETE CASCADE,
  CONSTRAINT `flight_sic_id_sf_guard_user_id` FOREIGN KEY (`sic_id`) REFERENCES `sf_guard_user` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=33 DEFAULT CHARSET=utf8;
